def getHalfmaskCipher(filename):
    halfmasks = []
    ciphers = []
    with open(filename, 'r') as f:
        contents = f.read().split("\n")
        for line in contents:
            l = line.split(",")
            if(len(l) == 2):
                halfmasks.append(int(l[0]))
                ciphers.append(int(l[1]))
    return halfmasks, ciphers



def main():
    halfmasks, ciphers = getHalfmaskCipher("a3.cipher")

    for i in range(len(halfmasks)):
        h = halfmasks[i]
        c = ciphers[i]
        invFullmask = pow(h, -a, p)
        m = ( invFullmask * c ) % p
        print(chr(m), end="")



if __name__ == "__main__":
    main()